import styled from 'styled-components';

export const Input = styled.input`
  height: 32px;
  outline: none;
  border-radius: 4px;
  padding: 0 10px;
  margin-right: 10px;
  min-width: 200px;
  border: 1px solid rgba(224, 224, 224, 1);
`;
